function pairsByKeys(t)
local a = {}
for n in pairs(t) do
	a[#a+1] = n
end
table.sort(a)
local i = 0
return function ()
		i = i + 1
		return a[i],t[a[i]]
	end
end

function getcollection(t,i,j)
local a = false
if j ~= 'collectionId'  or t == '' then else
for n,v in pairs(t) do
	if v == i then
	a = true
	end
end
end
return a
end

